import React from 'react'

import axios from 'axios'

import { Formik, Field, Form } from 'formik'

const ComplexInformations = (props) => {
    return (
        <>
            <Formik
                initialValues={{
                    complex_informations: {
                        complex_name: '',
                        complex_house_number: '',
                        city: '',
                        postal_code: '',
                        phone_number: '',
                        email: '',
                        street: '',
                        complex_house_number_extension: '',
                        country: '',
                        phone_number_landcode: '',
                        opening_hours: '',
                        complex_facility_types: {
                            complex_kitchen: '',
                            complex_bathroom: '',
                            complex_supermarket: '',
                            complex_fitness: '',
                            complex_common_room: '',
                            complex_reception_office: '',
                            complex_laundry: '',
                            complex_relax: ''
                        }
                    }
                }}
                onSubmit={( data ) => {
                    console.log(data)
                    const res = axios.post('http://10.0.4.5:8000/api/v1/vhe/registerintroduction/', data)
                    res.then(res => { console.log('res', res) }).catch( error => { console.log(error) })
                    props.next(data)
                }}
            >
            {({
                values,
                handleChange,
                handleBlur
            }) => (
                <Form>
                    <div>Complex name</div>
                    <div>
                        <label>
                            <Field type='text' name='part_of_complex' value='true' />
                            Yes
                        </label>
                    </div>

                    {values.part_of_complex && (
                        <>
                            <div>Part of a complex</div>
                            <div>
                                <label>
                                    <Field type='radio' name='is_existing_complex' value='true' />
                                    Yes
                                </label>
                                <label>
                                    <Field type='radio' name='is_existing_complex' value='false' />
                                    No
                                </label>
                            </div>
                        </>
                    )}

                    {values.part_of_complex && values.is_existing_complex && (
                        <>
                            <label htmlFor='existing_complex_name' style={{ display: 'block' }}>
                                Complex name
                            </label>
                            <select
                                name='existing_complex_name'
                                value={values.existing_complex_name}
                                onChange={handleChange}
                                onBlur={handleBlur}
                                style={{ display: 'block' }}
                            >
                                <option value='' label='Select a complex' />
                                {allData.map((item, index) => (
                                    <option key={index} value={item.id} label={item.complex_name} />
                                ))}
                            </select>
                        </>
                    )}

                    <label htmlFor='residence_type' style={{ display: 'block' }}>
                        Complex name
                    </label>
                    <select
                        name='residence_type'
                        value={values.residence_type}
                        onChange={handleChange}
                        onBlur={handleBlur}
                        style={{ display: 'block' }}
                    >
                        {residenceTypes__array.map((item, index) => (
                            <option key={index} value={item.value} label={item.label} />
                        ))}
                    </select>

                    <label htmlFor='vhe_type' style={{ display: 'block' }}>
                        Complex name
                    </label>
                    <select
                        name='vhe_type'
                        value={values.vhe_type}
                        onChange={handleChange}
                        onBlur={handleBlur}
                        style={{ display: 'block' }}
                    >
                        {livingPlaceTypes__array.map((item, index) => (
                            <option key={index} value={item.value} label={item.label} />
                        ))}
                    </select>

                    <button type='submit'>Submit</button>
                </Form>
            )}
            </Formik>
        </>
    )
}

export default ComplexInformations
